class MockConfig(object):
    def __init__(self, oracle_script_id, min_count, ask_count, task_fee):
        self.oracle_script_id = oracle_script_id
        self.min_count = min_count
        self.ask_count = ask_count
        self.task_fee = task_fee

    def to_tuple(self):
        return self.oracle_script_id, self.min_count, self.ask_count, self.task_fee


class MockTask(object):
    def __init__(
            self,
            is_resolved=False,
            time=0,
            caller="0x" + ("00" * 20),
            task_fee=0,
            seed="0x" + ("00" * 32),
            client_seed="",
            proof="0x00",
            result="0x00"
    ):
        self.is_resolved = is_resolved
        self.time = time
        self.caller = caller
        self.task_fee = task_fee
        self.seed = seed
        self.client_seed = client_seed
        self.proof = proof
        self.result = result

    def to_tuple(self):
        return (
            self.is_resolved,
            self.time,
            self.caller,
            self.task_fee,
            self.seed,
            self.client_seed,
            self.proof,
            self.result
        )


